import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
    navLinks:{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        marginLeft: theme.spacing(10)
    }
}

))
